/* keyup function */
$(document).ready(function(){

    jQuery(".chosen").chosen();

  //dataTable initialize
  $('table[data-toggle="dataTable"]').DataTable({
    "sPaginationType": "full_numbers",
    "iDisplayLength": 10,
    "aLengthMenu": [[5, 10, 25, 50, -1], [5, 10, 25, 50, "All"]],
    "bStateSave": true
  });

    /* colorbox iframe */
    $(".iframe").colorbox({iframe:true, width:"600px", height:"82%"});





/* Ajax Form */
    $('form[data-toggle="form-ajax"]').on('submit', function(evt){

    evt.preventDefault();

    var txt;

    var r = confirm('Are You Sure To Save ?');
    if (r == false) return false;

    $form = $(this);
    $url = $form.prop('action');
    $data_url = $form.data('url');

    values = $form.serialize();
    //console.log($url);

    $.ajax({
      url: $url,
      type: "POST",
      data: values,
      cache: false,
      beforeSend: function(){
        $('#ajax_loader').html('<img src="/images/ajax-loader.gif">');
      },
      success: function(data){

          $('#ajax_loader').hide(500);

          //console.log(data);

          $.pnotify.defaults.styling = "bootstrap3";

          $.pnotify({
                  title: 'Success',
                  text:  'Successfully Created',
                  type: 'success',
                  icon: 'picon picon-dialog-ok-apply',
                  delay: '3000'
              });

          if( $data_url != 'No'){
              window.open( $url + "/" + data.id,"_blank");
          }

          $('#ajax_loader').hide(500);
          //$('#foo')[0].reset();
              //$('#patient_name').focus();

      },
      error: function(data){

          var error = data.responseJSON;

          var text='';
          for (x in error) {
              text += error[x] + '<br />';
          }

          $.pnotify({
              title: 'Warning',
              text:  text,
              type: 'warning',
              icon: 'picon picon-dialog-ok-apply',
              delay: '3000'
          });

          $('#ajax_loader').hide(500);
         // $('#ajax_loader').hide().html('There is a error while submit').fadeIn(500);
      }
    });

  });


    /* Numeric Field, Declare Class .numeric_field */
    $('.numeric_field').ForceNumericOnly();


    $.validate(); /* For Jquery Form Validation */

}); /* Jquery End */


jQuery.fn.ForceNumericOnly = function(){
  return this.each(function(){
    $(this).keydown(function(e){
      var key = e.charCode || e.keyCode || 0;
      // allow backspace, tab, delete, arrows, numbers and keypad numbers ONLY
      // home, end, period, and numpad decimal
      return (
      key == 8 ||
      key == 9 ||
      key == 46 ||
      key == 110 ||
      key == 190 ||
      (key >= 35 && key <= 40) ||
      (key >= 48 && key <= 57) ||
      (key >= 96 && key <= 105)
      );
    });
  });
};



